-------------------------------------------------------------------------------
--                                CREATE TABLE                               --
-------------------------------------------------------------------------------

CREATE TABLE R (
	A int,
	B int
);



CREATE TABLE S (
	C int,
	D int
);



CREATE TABLE T (
	E int,
	F int
);



CREATE TABLE PK_R (
	A int PRIMARY KEY,
	B int
);




CREATE TABLE PK_S (
	C int,
	D int,
	PRIMARY KEY (C,D)
);



CREATE TABLE TEMP_TEST (
	A INT,
	B INT,
	T_BEGIN INT,
	T_END INT
);




CREATE TABLE TEMP_DATE (
	A INT,
	B INT,
	T_BEGIN DATE,
	T_END DATE
);



CREATE TABLE TEMP_EMP (
  EMPID INT,
  SALARY INT,
  FROM_DATE DATE,
  DATE DATE
);


CREATE TABLE FBA_TEST (
	A INT,
	B INT
);

-------------------------------------------------------------------------------
--                                   TPC-H                                   --
-------------------------------------------------------------------------------

CREATE TABLE part (
	p_partkey 	INT8,
	p_name		VARCHAR(55),
	p_mfgr		VARCHAR(25),
	p_brand		VARCHAR(10),
	p_type		VARCHAR(25),
	p_size		INT8,
	p_container	VARCHAR(10),
	p_retailprice	FLOAT8,
	p_comment	VARCHAR(23),
	PRIMARY KEY (p_partkey)
);

CREATE TABLE supplier (
	s_suppkey	INT8,
	s_name		VARCHAR(25),
	s_address	VARCHAR(40),
	s_nationkey	INT8,
	s_phone		VARCHAR(15),
	s_acctbal	FLOAT8,
	s_comment	VARCHAR(101),
	PRIMARY KEY (s_suppkey)
);

CREATE TABLE partsupp (
	ps_partkey	INT8,
	ps_suppkey	INT8,
	ps_availqty	INT8,
	ps_supplycost	FLOAT8,
	ps_comment	VARCHAR(199),
	PRIMARY KEY (ps_partkey, ps_suppkey)
);

CREATE TABLE customer (
	c_custkey	INT8,
	c_name		VARCHAR(25),
	c_address	VARCHAR(40),
	c_nationkey	INT8,
	c_phone		VARCHAR(15),
	c_acctbal	FLOAT8,
	c_mktsegment	VARCHAR(10),
	c_comment	VARCHAR(117),
	PRIMARY KEY (c_custkey)
);

CREATE TABLE orders (
	o_orderkey	INT8,
	o_custkey	INT8,
	o_orderstatus	VARCHAR(1),
	o_totalprice	FLOAT8,
	o_orderdate	DATE,
	o_orderpriority	VARCHAR(15),
	o_clerk		VARCHAR(15),
	o_shippriority	INT8,
	o_comment	VARCHAR(79),
	PRIMARY KEY (o_orderkey)
);

CREATE TABLE lineitem (
	l_orderkey	INT8,
	l_partkey	INT8,
	l_suppkey	INT8,
	l_linenumber	INT8,
	l_quantity	FLOAT8,
	l_extendedprice	FLOAT8,
	l_discount	FLOAT8,
	l_tax		FLOAT8,
	l_returnflag	VARCHAR(1),
	l_linestatus	VARCHAR(1),
	l_shipdate	DATE,
	l_commitdate	DATE,
	l_receiptdate	DATE,
	l_shipinstruct	VARCHAR(25),
	l_shipmode	VARCHAR(10),
	l_comment	VARCHAR(44),
	PRIMARY KEY (l_orderkey, l_linenumber)
);

CREATE TABLE nation (
	n_nationkey	INT8,
	n_name		VARCHAR(25),
	n_regionkey	INT8,
	n_comment	VARCHAR(152),
	PRIMARY KEY (n_nationkey)
);

CREATE TABLE region (
	r_regionkey	INT8,
	r_name		VARCHAR(25),
	r_comment	VARCHAR(152),
	PRIMARY KEY (r_regionkey)
);

